import React, { FC } from 'react';
import { PcaWrapper } from './pca.styled';
import Pagination from 'react-bootstrap/Pagination';
import CardCar from '../CardCar/CardCar';


interface CarData {
   model: string;
   model_year: number;
   fuel: {
     ua: string;
   };
   displacement: number;
   kind: {
     ua: string;
   };
   is_registered_to_company: boolean;
   registered_at: string;
   own_weight: number;
   total_weight: number;
   department: string;
   operation: {
     ua: string;
   };
 }

interface CarProps {
  car: {
    comments: string[];
    digits: string;
    is_stolen: boolean;
    model: string;
    model_year: number;
    operations: Array<CarData>;
    photo_url: string;
    region: {
      name: string;
      name_ua: string;
      slug: string;
      old_code: string;
      new_code: string;
    };
    stolen_details: any;
    vendor: string;
    vin: string;
  } | null | string;
  nomer?: string; 
}

const Pca: FC<CarProps> = ({ car, nomer = "" }) => {
